		document.addEventListener('DOMContentLoaded', function() {

			alert("JESUS IS LORD FOREVER");
			let isModalVisible = false;
			console.log("JESUS IS LORD FOREVER AND EVER! AND EVER!!!");


			// Check if the page URL has ?modal=image query parameter
			const urlParams = new URLSearchParams(window.location.search);
			if (urlParams.has('modal') && urlParams.get('modal') === 'image') {
				showImageModal();
			}

			// Event listener for browser back/forward navigation
			window.addEventListener('popstate', function(event) {
				const urlParams = new URLSearchParams(window.location.search);
				if (urlParams.has('modal') && urlParams.get('modal') === 'image') {
					showImageModal();
				} else {
					hideImageModal();
					// Remove the ?modal=image query parameter from the URL
					const url = window.location.href.split('?')[0];
					history.pushState({}, document.title, url);
				}
			});

			// Function to show the image modal
			function showImageModal() {
				const modal = document.getElementById('imageModal');
				if (modal) {
					modal.classList.add('activem');
					isModalVisible = true;
				}
			}

			// Function to hide the image modal
			function hideImageModal() {
				const modal = document.getElementById('imageModal');
				if (modal) {
					modal.classList.remove('activem');
					isModalVisible = false;
				}
			}

			// Function to handle modal closing
			function closeModal() {
				hideImageModal();
				// Remove the ?modal=image query parameter from the URL
				const url = window.location.href.split('?')[0];
				history.pushState({}, document.title, url);
			}

			// Example: Click event for closing modal
			const closeButton = document.getElementById('closeModalBtn');
			if (closeButton) {
				closeButton.addEventListener('click', function() {
					closeModal();
				});
			}

			console.log("1: ", "Hi");
			// Example: Function to open modal based on user action
			const openModalButton = document.getElementById('openModalBtn');
			console.log("1: ", openModalButton);
			if (openModalButton) {
				console.log("2: ", openModalButton);
				openModalButton.addEventListener('click', function() {
					showImageModal();
					// Add ?modal=image to the URL
					history.pushState({}, document.title, '?modal=image');
				});
			}
		});
	</script>
