	<script type="module">
		(async () => {
			const {
				loadTemplate,
				verifymobilenomodal,
				cleaner
			} = await import('../assets/js/signupscript.js');
		});
		setTimeout(function() {
			document.querySelector('.all_appContent').classList.add('page-activated');
		}, 3000);


		let canAddDash = false;
		const mobileNumberInput = document.getElementById('mobileNumberInput');
		const mandatoryOnInput = document.querySelectorAll('.mandatoryto_m');
		const ctnButton = document.querySelector('.continue.next button');
		const outMain = document.querySelector('.out_main');

		// Focus the input box once page load
		// mobileNumberInput.setAttribute('autofocus', '');

		// CHECK IF THE 'MANDATORY IS EMPTY, TAKE ACTION ACCORDINGLY)
		mandatoryOnInput.forEach(minput => {
			if (minput.value.length < 1 || minput.value.length > 12) {
				ctnButton.disabled = true;
				ctnButton.style.background = "#ddeb";
			}
		});

		// Open modal

		// Import the necessary functions and templates dynamically
		if (ctnButton) {
			ctnButton.addEventListener('click', function() {
				nextStep();
				// loadTemplate(verifymobilenomodal);
				if (outMain) {
					// outMain.classList.add('active');
				}
			});
		}

		function formatMobileNumber() {
			let val = mobileNumberInput.value.replace(/\D/g, ''); // Remove all non-digit characters

			// Remove leading zero if present
			if (val.startsWith('0')) {
				val = val.slice(1);
			}

			// Insert dashes at the appropriate positions
			if (val.length > 4) {
				val = val.slice(0, 4) + ' - ' + val.slice(4);
			}
			if (val.length > 10) {
				val = val.slice(0, 10) + ' - ' + val.slice(10);
			}
			mobileNumberInput.value = val;

			if (val.length === 16) {
				ctnButton.style.background = "";
				ctnButton.disabled = false;
			} else {
				ctnButton.style.background = "#ddeb";
				ctnButton.disabled = true;
			}
		}

		mobileNumberInput.addEventListener('keypress', function(event) {
			if (event.key === 'Enter') {
				event.preventDefault();
				if (mobileNumberInput.value.length === 16) {
					// alert("JESUS IS LORD FOREVER");
					loadTemplate(verifymobilenomodal);
					outMain.classList.add('active');
				}
			}; // Ignore Enter key
			setTimeout(formatMobileNumber, 0);
			var val = mobileNumberInput.value;
		});

		mobileNumberInput.addEventListener('input', function() {
			var val = mobileNumberInput.value;

			// Remove leading zero if only one digit
			if (val[0] === '0' && val.length <= 1) {
				mobileNumberInput.value = '';
			}

			// Check maximum length
			if (val.length > 16) {
				mobileNumberInput.value = mobileNumberInput.value.slice(0, 16);
			}

			formatMobileNumber();
		});

		mobileNumberInput.addEventListener('paste', function(event) {
			setTimeout(function() {
				formatMobileNumber();
			}, 0);
		});


		if ('serviceWorker' in navigator) {
			navigator.serviceWorker.register('../assets/js/serviceworker.js')
				.then(registration => {
					console.log('Service Worker registered with scope:', registration.scope);
				})
				.catch(error => {
					alert('Service Worker registration failed:', error);
				});
		} else {
			/*alert("JESUS REMAINS LORD OVER US ALL FOREVER!");*/
		}

		// Multi-step form logic
		let currentStep = 1;
		const formMulti = document.getElementById('form_multi_step');
		const FormStep = document.querySelectorAll('.form_step');
		const countingElement = document.querySelector('.page_info p');
		const formError = document.querySelector('.form_error_place');
		const formErrorText = document.querySelector('.form_error_place p');

		window.addEventListener('popstate', function(event) {
			const state = event.state;
			if (state) {
				currentStep = state.step;
				updateStep();
			}
		});

		// alert("JESUS IS LORD FOREVER");

		// nextStep function
		function nextStep() {
			if (currentStep < 2) {
				currentStep++;
				updateStep();
				// Update the browser's history state
				history.pushState({
					step: currentStep
				}, null, null);
			}
		}

		// prevStep function
		function prevStep() {
			if (currentStep > 1) {
				currentStep--;
				updateStep();
				// Update the browser's history state
				history.pushState({
					step: currentStep
				}, null, null);
			}
		}

		// Declare updateStep() function
		updateStep();

		// Define 'updateStep()' function
		function updateStep() {
			const FormStep = document.querySelectorAll('.form_step');
			FormStep.forEach(step => {
				step.classList.remove('active');
			});
			const currentStepElement = document.getElementById(`step-${currentStep}`);
			if (currentStepElement) {
				currentStepElement.classList.add('active');
				outMain.classList.remove('active');
			}

			console.log(`step-${currentStep}`);
		}

		// Update the browser's history state
		history.replaceState({
			step: currentStep
		}, null, null);
		// Adding event listeners to dynamically added buttons
		document.addEventListener('click', function(event) {
			if (event.target.matches('.nextStepButton')) {
				nextStep();
			} else if (event.target.matches('.prevStepButton')) {
				prevStep();
			}
		});
	</script>
